    [],nt"num_tags": 0,nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surfacee2",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144353 includes Surface
    underway data collected from Marcus G. Langseth in the North Pacific Ocean from
    2010-05-07 to 2010-09-30. These data include BAROMETRIC PRESSURE, Partial pressure
    (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The
    instruments used to collect these data include Carbon dioxide (CO2) gas analyzer
    and Shower head chamber equilibrator for autonomous carbon dioxide (CO2) measurement.nnThese
    data were collected by Taro Takahashi and Stewart Sutherland of Columbia University;
    Lamont-Doherty Earth Observatory and Colm Sweeney of University of Colorado at Boulder;
    Cooperative Institute for Research In Environmental Sciences as part of the VOS_Marcus_Langseth_Lines_2010
    data set. CDIAC associated the following cruise ID(s) with this data set: 33H320100507nnThe
    Global Volunteer Observing Ship (VOS) Program is coordinated by the UNESCO International
    Ocean Carbon Coordination Project (IOCCP). International groups from 14 countries
    have been outfitting research ships and commercial vessels with automated CO2 sampling
